def obtain_breakdown_voltage(voltages, currents):
    # Filtrar datos con corrientes negativas o cero
    valid_indices = currents > 0
    voltages = voltages[valid_indices]
    currents = currents[valid_indices]

    if len(voltages) == 0 or len(currents) == 0:
        raise ValueError("No valid data points after filtering negative or zero currents.")

    # Calcular el logaritmo natural de la corriente
    log_currents = np.log(currents)

    # Calcular la derivada del logaritmo de la corriente respecto al voltaje
    d_log_currents_dV = np.gradient(log_currents, voltages)

    # Calcular la inversa de la derivada
    inverse_derivative = 1 / d_log_currents_dV

    # Filtrar valores positivos de la derivada para evitar problemas
    positive_indices = inverse_derivative > 0
    voltages = voltages[positive_indices]
    inverse_derivative = inverse_derivative[positive_indices]

    if len(voltages) == 0:
        raise ValueError("No valid data points after filtering negative inverse derivative values.")

    # Promediar los valores de Vbd como estimación final
    peak_index = np.argmin(inverse_derivative)
    Vbd = voltages[peak_index]

    return Vbd, voltages, inverse_derivative, peak_index


